"""## Sávdetektálás

Az alábbiakban egy egyszerű szín és gradiens alapú sávdetektálást végzünk. A megoldás négy részből áll

1.   Deriváltak számolása
2.   Gradiens iránya és nagysága alapján a megfelelő élek megtartása
3.   Szín alapú küszöbözés a szaturáció alapján
4.   Két küszöbözött kép kombinálása


"""

import cv2
import numpy as np

"""### <font color='red'>Deriváltak</font>

1.   Sobel operátor segítségével számoljuk ki az x és y irányú deriváltakat
2.   Vegyük ezek abszolút értékét (ezeket majd a végén adjuk vissza)
3.   Mindkettőt normáljuk 0-255 közé (ezeket is adjuk majd vissza) uint8-ra konvertálva


"""

# Compute scaled absolute image gradients
def create_sobels(image, sobel_kernel=3):
    # Convert to gray
    gray = cv2.cvtColor(image, cv2.COLOR_BGR2GRAY)
    # Compute x and y derivatives using sobel
    sobelx = cv2.Sobel(gray, cv2.CV_32F, 1, 0, ksize=sobel_kernel)
    sobely = cv2.Sobel(gray, cv2.CV_32F, 0, 1, ksize=sobel_kernel)
    # Get absolute value
    abs_sobelx = np.absolute(sobelx)
    abs_sobely = np.absolute(sobely)
    
    # Compute scaling factor - norm [0 - x] images to [0 - 255]
    scale_factor=(1/np.max(abs_sobelx))*255

    # Scale gradients
    scaled_sobelx=np.uint8(abs_sobelx*scale_factor)
    scaled_sobely=np.uint8(abs_sobely*scale_factor)
    

    return abs_sobelx,abs_sobely,scaled_sobelx,scaled_sobely

"""### <font color='red'>Gradiens nagysága alapján küszöbözés</font>

Adjunk vissza egy olyan bináris képet, ami ott 1, ahol a gradiens nagysága a mag_thresh által megadott tartományba esik. Használjunk city-block normát (|x| + |y|) a gyorsaság kedvéért.

**Feladat:** Találjatok ki jó threshold értékeket az alábbi függvényekhez
"""

# Threshold gradients based on magintude
def mag_thresh(scaled_sobelx, scaled_sobely, mag_thresh=(0, 255*2)):
    # Compute gradient magnitude
    mag=scaled_sobelx + scaled_sobely
    # Threshold using inRange
    mag_binary = cv2.inRange(mag, mag_thresh[0], mag_thresh[1])

    return mag_binary

"""### <font color='red'>Gradiens iránya alapján küszöbözés</font>

Adjunk vissza egy olyan bináris képet, ami ott 1, ahol a gradiens iránya a thresh által megadott tartományba esik. 

**Kérdés:** Miért jó nekünk itt az abszolút értékek használata? Az nem rontja el a gradiens irányát?
"""

# Threshold gradients based on direction
def dir_threshold(abs_sobelx, abs_sobely, thresh=(0, np.pi/2)):
    # Compute gradient direction
    dir = np.arctan2(abs_sobelx, abs_sobely)

    # Threshold using inRange
    dir_binary=cv2.inRange(dir, thresh[0], thresh[1])

    return dir_binary

"""### <font color='red'>Szín alapján küszöbözés</font>

Adjunk vissza egy olyan bináris képet, ami ott 1, ahol a szaturáció elég nagy. A jó threshold értéket az egyes bináris képek külön-külön történő megjelenítésével tudjátok belőni.
"""

# Apply color threshold
def color_threshold(image, thresh=(0, 255)):
    # Convert to HLS
    hls_image=cv2.cvtColor(image, cv2.COLOR_BGR2HLS)
    # Get saturation
    s=hls_image[:, :, 2]
    # Threshold using inRange
    s_binary=cv2.inRange(s, thresh[0], thresh[1])

    return s_binary

"""### <font color='red'>Küszöbök kombinálása</font>

Hívjuk meg az előző függvényeket, és ezeket kombináljuk egy bináris képpé össze.

**Kérdés:** Milyen logikai műveletekkel érdemes ezeket kombinálni? Miben más az él és a szín alapú sávdetektálás?
"""

# Combine all kinds of thresholds
def apply_thresholds(image, ksize=3, return_all=False):
    # Get derivatives
    abs_sobelx,abs_sobely,scaled_sobelx,scaled_sobely=create_sobels(image, 3)
    # Compute magnitude and direction threshold
    mag_binary=mag_thresh(scaled_sobelx, scaled_sobely, (100, 510))
    dir_binary=dir_threshold(abs_sobelx, abs_sobely, (np.pi/2*0.85, np.pi/2))
    
    # Compute color threshold
    s_binary=color_threshold(image, (150, 255))

    # Combine all thresholded images
    combined = np.zeros_like(mag_binary)
    combined[((mag_binary == 255) & (dir_binary == 255)) | (s_binary == 255)] = 1

    if(return_all):
      return [mag_binary, dir_binary, s_binary, combined]
    return combined

