"""## <font color='red'>Sávok pozíciójának meghatározása</font>

Ez a lépés két alapvető részből áll:

1.   A képek madártávlati nézetbe transzformájuk egy prespektív torzítás segítségével. Fix kamerahelyzet esetén fix transzformációt tudunk használni.
2.   Az így kapott kép alsó feléből (ahol a sávok még kb egyenesek, mivel az autóhoz közel vannak) egy olyan hisztogramot készítünk, amely minden x pozícióhoz megadja az adott kép oszlopban lévő 1 pixelek mennyiségét. Az így kapott hisztogram két csúcsa lesz a két sáv pozíciója

A perspektív transzformáció 4 pontpárból egyszerű lineáris egyenletrendszer megoldásával meghatározható. A fix kamera esetében ezt a négy pontpárt egyszerű "rábökéssel" meg tudjuk határozni ("Ezt a pontot ide transzformáld")

**Fontos:** A transzformáció inverzét is számoljuk ki, mert ez majd a megjelenítéshez kelleni fog a programnak (ezt adjuk is vissza: Minv néven)


"""

def warp(img):
    img_size = (img.shape[1], img.shape[0])

    # Source and destination points
    src = np.float32(
        [[380, 0],
          [875, 235],
          [60, 235],
          [470, 0]])

    dst = np.float32(
        [[150, 0],
         [800, 260],
         [150, 260],
         [800, 0]])

    # Get perspective transforms
    M = cv2.getPerspectiveTransform(src, dst)
    Minv = cv2.getPerspectiveTransform(dst, src)

    # Warp image
    binary_warped = cv2.warpPerspective(img, M, img_size, flags=cv2.INTER_LINEAR)


    return binary_warped, Minv

