"""## <font color='green'>Linedetector Objektum</font>

Ez az objektum meghívja a fennt elkészített függvényeket, és a meghívandó process_image() visszaadja az annotált képet (result) a becsült eltérést a sávközéptől (deviation), valamint a fordulási sugarat (left_curverad)

**Ennek az osztálynak a process_image függvényét kell majd a main-ben meghívni**
"""

class LineDetector(object):

    def draw_lane_lines(self, original_image, warped_image, Minv, draw_info):
        leftx = draw_info['leftx']
        rightx = draw_info['rightx']
        left_fitx = draw_info['left_fitx']
        right_fitx = draw_info['right_fitx']
        ploty = draw_info['ploty']

        warp_zero = np.zeros_like(warped_image).astype(np.uint8)
        color_warp = np.dstack((warp_zero, warp_zero, warp_zero))

        pts_left = np.array([np.transpose(np.vstack([left_fitx, ploty]))])
        pts_right = np.array([np.flipud(np.transpose(np.vstack([right_fitx, ploty])))])
        pts = np.hstack((pts_left, pts_right))

        cv2.fillPoly(color_warp, np.int_([pts]), (0,255, 0))

        newwarp = cv2.warpPerspective(color_warp, Minv, (original_image.shape[1], original_image.shape[0]))
        result = cv2.addWeighted(original_image, 1, newwarp, 0.3, 0)

        return result

    def slide_window(self, binary_warped, histogram):

        # Get line bases
        midpoint = np.int(histogram.shape[0]/2)
        leftx_base = np.argmax(histogram[:midpoint])
        rightx_base = np.argmax(histogram[midpoint:]) + midpoint

        # Define sliding window
        nwindows = 9
        window_height = np.int(binary_warped.shape[0]/nwindows)

        # Get nonzero pixels
        nonzero = binary_warped.nonzero()
        nonzeroy = np.array(nonzero[0])
        nonzerox = np.array(nonzero[1])

        # Initialize sliding window
        leftx_current = leftx_base
        rightx_current = rightx_base
        margin = 100
        minpix = 50
        left_lane_inds = []
        right_lane_inds = []

        for window in range(nwindows):
            # Compute window coordinates
            win_y_low = binary_warped.shape[0] - (window+1)*window_height
            win_y_high = binary_warped.shape[0] - window*window_height
            win_xleft_low = leftx_current - margin
            win_xleft_high = leftx_current + margin
            win_xright_low = rightx_current - margin
            win_xright_high = rightx_current + margin

            # Gather points that fit into the window
            good_left_inds = ((nonzeroy >= win_y_low) & (nonzeroy < win_y_high) &
            (nonzerox >= win_xleft_low) &  (nonzerox < win_xleft_high)).nonzero()[0]
            good_right_inds = ((nonzeroy >= win_y_low) & (nonzeroy < win_y_high) &
            (nonzerox >= win_xright_low) &  (nonzerox < win_xright_high)).nonzero()[0]

            # Append to list
            left_lane_inds.append(good_left_inds)
            right_lane_inds.append(good_right_inds)

            # If found enough pixels, then shift the line midpoint
            if len(good_left_inds) > minpix:
                leftx_current = np.int(np.mean(nonzerox[good_left_inds]))
            if len(good_right_inds) > minpix:
                rightx_current = np.int(np.mean(nonzerox[good_right_inds]))

        # Reshape index array
        left_lane_inds = np.concatenate(left_lane_inds)
        right_lane_inds = np.concatenate(right_lane_inds)

        # Gather point coordinates
        leftx = nonzerox[left_lane_inds]
        lefty = nonzeroy[left_lane_inds]
        rightx = nonzerox[right_lane_inds]
        righty = nonzeroy[right_lane_inds]

        # Fit second orde polynoms
        left_fit = np.polyfit(lefty, leftx, 2)
        right_fit = np.polyfit(righty, rightx, 2)

        # Get points that fit on the polynoms
        left_lane_inds = ((nonzerox > (left_fit[0]*(nonzeroy**2) + left_fit[1]*nonzeroy +
        left_fit[2] - margin)) & (nonzerox < (left_fit[0]*(nonzeroy**2) +
        left_fit[1]*nonzeroy + left_fit[2] + margin)))

        right_lane_inds = ((nonzerox > (right_fit[0]*(nonzeroy**2) + right_fit[1]*nonzeroy +
        right_fit[2] - margin)) & (nonzerox < (right_fit[0]*(nonzeroy**2) +
        right_fit[1]*nonzeroy + right_fit[2] + margin)))

        # Refit polynom
        leftx = nonzerox[left_lane_inds]
        lefty = nonzeroy[left_lane_inds]
        rightx = nonzerox[right_lane_inds]
        righty = nonzeroy[right_lane_inds]
        left_fit = np.polyfit(lefty, leftx, 2)
        right_fit = np.polyfit(righty, rightx, 2)

        # Generate polynom points
        ploty = np.linspace(0, binary_warped.shape[0]-1, binary_warped.shape[0] )
        left_fitx = left_fit[0]*ploty**2 + left_fit[1]*ploty + left_fit[2]
        right_fitx = right_fit[0]*ploty**2 + right_fit[1]*ploty + right_fit[2]

        # Return value
        ret = {}
        ret['leftx'] = leftx
        ret['rightx'] = rightx
        ret['left_fitx'] = left_fitx
        ret['right_fitx'] = right_fitx
        ret['ploty'] = ploty

        return ret

    def measure_curvature(self, lines_info):
        # Approximate meters per pixels
        ym_per_pix = 30/(260)
        xm_per_pix = 3.7/(650)

        # Get polynom points
        leftx = lines_info['left_fitx']
        rightx = lines_info['right_fitx']

        # Reverse order
        leftx = leftx[::-1]
        rightx = rightx[::-1]

        ploty = lines_info['ploty']

        # Compute corvature
        y_eval = np.max(ploty)
        left_fit_cr = np.polyfit(ploty*ym_per_pix, leftx*xm_per_pix, 2)
        right_fit_cr = np.polyfit(ploty*ym_per_pix, rightx*xm_per_pix, 2)
        left_curverad = ((1 + (2*left_fit_cr[0]*y_eval*ym_per_pix + left_fit_cr[1])**2)**1.5) / np.absolute(2*left_fit_cr[0])
        right_curverad = ((1 + (2*right_fit_cr[0]*y_eval*ym_per_pix + right_fit_cr[1])**2)**1.5) / np.absolute(2*right_fit_cr[0])

        return left_curverad, right_curverad

    def sanity(self, ret, left_curverad, right_curverad):
        # Sanity check: whether the lines are roughly parallel and have similar curvature
        slope_left = ret['left_fitx'][0] - ret['left_fitx'][-1]
        slope_right = ret['right_fitx'][0] - ret['right_fitx'][-1]
        slope_diff = abs(slope_left - slope_right)
        slope_threshold = 150
        curve_diff = abs(left_curverad - right_curverad)
        curve_threshold = 10000

        return (slope_diff < slope_threshold and curve_diff < curve_threshold)


    def process_image(self, image):

        roi = image[450:710, 220:1150]

        # Thresholding
        binary = apply_thresholds(roi)

        # Transforming Perspective
        binary_warped, Minv = warp(binary)

        # Getting Histogram
        histogram = get_histogram(binary_warped)

        # Sliding Window to detect lane lines
        ret = self.slide_window(binary_warped, histogram)

        # Measuring Curvature
        left_curverad, right_curverad = self.measure_curvature(ret)

        # Sanity check
        if not self.sanity(ret,left_curverad,right_curverad):
            # Use last good images if sanity check fails
            binary_warped = self.used_warped
            ret = self.used_ret

        result = image

        # Visualizing Lane Lines Info
        result[450:710, 220:1150] = self.draw_lane_lines(roi, binary_warped, Minv, ret)

        # Compute deviation
        deviation_pixels = image.shape[1]/2 - abs(ret['right_fitx'][-1] - ret['left_fitx'][-1])
        xm_per_pix = 3.7/(650)
        deviation = deviation_pixels * xm_per_pix

        # update last good images
        self.used_warped = binary_warped
        self.used_ret = ret

        return result, deviation, left_curverad

"""## <font color='red'>Szűrő osztály megírása</font>

Az alábbi osztály feladata, hogy a zajos deviation méréseket szűrje, valamint, hogy a sávtartási hiba deriváltját ezekből a szűrt értékekből előállítsa.

Ezeket az alábbi elv mentén végezzük el

1.   Független, Gauss zajjal terhelt mérések esetén ideális becslő (maximum likelihood értelemben) az átlag. Mivel persze ezek a mennyiségek időközben változnak, ezért a deviation és a curvature értékekből egy self.numEstim hosszú FIFO buffert tartunk fenn.
2.   A szűrt deviation értékeket szintén egy FIFO bufferben tároljuk (ez csak self.slopeNumEstim hosszú), és a deriváltat ezekből becsüljük LS becsléssel. Ha a szűrt deviation értékekre ugyanis egyenest illesztük, akkor ennek a meredeksége pont a deiválttal fog megegyezni (vagy annak a -1-szeresével a FIFO irányától függően)

A megoldáshoz az alábbi részt kell megírni

1.   Az update függvényben léptetni kell a FIFO-kat (ezek a konstruktorban vannak létrehozva - 1 a curvature 1 pedig a deviation értékekhez)
2.   Ki kell számolni az átlagokat
3.   Léptetni kell a harmadik, a szűrt deviation értékekhez tartozó FIFO-t
4.   Végrehajtjuk az LS becslést. Az LS becslés egy tuple objektumot ad vissza (coeff, error), melyek közül nekünk az előbbi kell. 
5.   Ki kell szedni a slope értéket, ami a 0. elem. (Tehát kétszer kell a 0. elemet kiszedni)
6.   Majd a két szűrt értéket és a deriváltat vissza kell adni.

**Segítség az LS becsléshez:** A cél, hogy a szűrt deviation értékekre egyenest illesszünk. Az egyenes egyenlete ugye ax + b = y, mátrixok alakban X*theta = Y. Az a és b a keresett paraméterek, az x és az 1 a konstansok, az y pedig a kívánt érték. Az LS becsléshez szükséges változókat a konstruktorban lehet keresni.




"""

class Estimator(object):
    def __init__(self):
        super(Estimator,self).__init__()

        # Number of measurements to use
        self.numEstim = 25

        # Number of estimates to use for slope estimation
        self.slopeEstimNum = 5

        # Iteration counter
        self.iter = 0

        # Arrays for input variables
        self.curvatures = np.zeros(self.numEstim)
        self.deviations = np.zeros(self.numEstim)

        # Store filtered deviations for slope estimation
        self.filteredDeviations = np.zeros(self.slopeEstimNum)

        # Create coefficient matrix for LS estimate
        '''
        [ 0 1 ]
        [ 1 1 ]
        [ 2 1 ]
        [ 3 1 ]
        [ 4 1 ]
        '''
        self.X = np.transpose(np.array([np.linspace(0,self.slopeEstimNum-1, num=self.slopeEstimNum),np.ones(self.slopeEstimNum)]))

    # curv and dev are the new measurements. 
    def update(self, curv, dev):

        # Shift the arrays
        self.curvatures = np.roll(self.curvatures, 1)
        self.deviations = np.roll(self.deviations, 1)


        # Write new elements to replace the 0th element
        self.curvatures[0]=curv
        self.deviations[0]=dev

        # Compute means
        curvEst=np.mean(self.curvatures)
        devEst=np.mean(self.deviations)


        # Shift the filteredDeviation array and add new deviation estimate
        self.filteredDeviations=np.roll(self.filteredDeviations, -1)
        self.filteredDeviations[-1]=devEst


        self.iter += 1

        if self.iter < self.slopeEstimNum:
            slopeEst = 0
        else:
            # Perform LS estimation to fit a line on the deviations
            # LS estimation returns (parameters, squared error), so get the first
            lineParams = np.linalg.lstsq(self.X, self.filteredDeviations, rcond=None)[0]


            # The first parameter is the one we are looking for
            slopeEst=lineParams[0]

        return curvEst,slopeEst,devEst

"""## <font color='red'>Fuzzy szabályzó tervezése</font>

A végén egy egyszerű fuzzy szabályzót készítünk. A feladat a következő elemekből épül:

1.   A bemeneteket és a szabályzó kimenetét 5 kategóriára (Negative Big, Negative Small, Zero, Positive Small, Positive Big) osztjuk. A normálások miatt ez esetünkben a [-2;+2] tartomány lesz.
2.   Ezután elkészítjük és elnevezzük a bemeneti (Antecedent) és kimeneti (Consequent) változókat
3.   Ezt követően létrehozunk 5 különböző szabályt (egyet mind az 5 fajta kimenethez): Minden egyes szabály azt mondja meg, hogy milyen bemenet kombinációk esetén adja ki a szabályzó az adott kategóriájú kimenetet
4.   Végezetül létrehozzuk és visszaadjuk a fuzzy szabályzót

A szabályok felállításához az alábbi kép szolgálhat segítségül:

![fuzzy.PNG](data:image/png;base64,)


"""

import skfuzzy.control as ctrl

def createController():
    # Fuzzy membership centers [-2 -1 0 1 2]
    universe = np.linspace(-2, 2, 5)
    names = ['nb', 'ns' , 'ze' , 'ps' , 'pb']

    # Create the three fuzzy variables - two inputs (error and delta), one output
    error = ctrl.Antecedent(universe, 'error')

    delta = ctrl.Antecedent(universe, 'delta')
    
    output = ctrl.Consequent(universe, 'output')

    # Name fuzzy variables - this connects the member classes [-2 -1 0 1 2] to names [nb, ns, z, ps, pb] that will be used by the rules
    error.automf(names=names)
    delta.automf(names=names)
    output.automf(names=names)

    # Rule 0: if the error is big negative and changing in the wrong direction, then output is big positive
    rule0 = ctrl.Rule(antecedent=((error["nb"] & delta["nb"]) | (error["nb"] & delta["ns"]) | (error["ns"] & delta["nb"])),
                      consequent=output["pb"], label="rule pb")

    # Rule 1: For somewhat more favourable combinations the output is small positive
    rule1 = ctrl.Rule(antecedent=((error["ns"] & delta["ns"]) | (error["ns"] & delta["ze"]) |
                                  (error["nb"] & delta["ps"]) | (error["nb"] & delta["ze"]) |
                                  (error["ze"] & delta["ns"]) | (error["ze"] & delta["nb"]) |
                                  (error["ps"] & delta["nb"])),
                      consequent=output["ps"], label="rule ps")


    # Rule 2: For good errors and good changes, the output is zero
    rule2 = ctrl.Rule(antecedent=((error["nb"] & delta["pb"]) |
                                  (error["ns"] & delta["ps"]) | 
                                  (error["ze"] & delta["ze"]) |
                                  (error["ps"] & delta["ns"]) |
                                  (error["pb"] & delta["nb"]) ),
                      consequent=output["ze"], label="rule ze")


    # Rule 3: For somewhat less favourable combinations the output is small negative
    rule3 = ctrl.Rule(antecedent=((error["pb"] & delta["ze"]) | (error["pb"] & delta["ns"]) |
                                  (error["ps"] & delta["ze"]) | (error["ps"] & delta["ps"]) |
                                  (error["ze"] & delta["pb"]) | (error["ze"] & delta["ps"]) |
                                  (error["ns"] & delta["pb"])),
                      consequent=output["ns"], label="rule ns")

    # Rule 4: if the error is big positive and changing in the wrong direction, then output is big negative
    rule4 = ctrl.Rule(antecedent=((error["ps"] & delta["pb"]) | (error["pb"] & delta["pb"]) | (error["pb"] & delta["ps"])),
                      consequent=output["nb"], label="rule nb")


    # Create fuzzy controller
    system = ctrl.ControlSystem(rules=[rule0, rule1, rule2, rule3, rule4 ])
    controller = ctrl.ControlSystemSimulation(system)


    # Return fuzzy simulator
    return controller

"""## <font color='green'>Képre rajzolás</font>"""

def drawImage(img, dev, cur):

    # Annotating curvature
    fontType = cv2.FONT_HERSHEY_SIMPLEX
    curvature_text = 'The radius of curvature = ' + str(round(cur, 3)) + 'm'
    cv2.putText(img, curvature_text, (30, 60), fontType, 0.5, (255, 255, 255), 1)

    # Annotating deviation
    direction = "left" if dev < 0 else "right"
    deviation_text = 'Vehicle is ' + str(round(abs(dev), 3)) + 'm ' + direction + ' of center'
    cv2.putText(img, deviation_text, (30, 110), fontType, 0.5, (255, 255, 255), 1)

    return img

"""## <font color='green'>Progress Bar</font>"""

from IPython.display import HTML, display

def progress(value, max=100):
    return HTML("""
        <progress
            value='{value}'
            max='{max}',
            style='width: 100%'
        >
            {value}
        </progress>
    """.format(value=value, max=max))

"""## <font color='red'>Fő függvény</font>

A következő algoritmust kellene megvalósítani

1.   Amíg van kép a videóban, minden frame-re futtatni kellene a sávdetektálást, a szűrést és a szabályzást
2.   Ezek kimeneteit az erre létrehozott üres tömbökhöz hozzáillesztve tárolni
3.   A kapott annotált képet az out nevezető videóba írni

A futás végezetével a fájlok közül letölthető lesz a videó "processed.mp4" néven

**A LineDetector, Estimator és Controller osztályok már létre vannak hozva, csak a megfelelő függvényeket kell meghívni**


"""

import time
from google.colab.patches import cv2_imshow

# Measure framerate
sum = 0
frameCnt = 0

# Create estimator and controller classes
estimator = Estimator()
controller = createController()
detector = LineDetector()

# Create empty arrays for plotting
devs = np.array([])
devFilts = np.array([])
curs = np.array([])
curFilts = np.array([])
slopeFilts = np.array([])
controls = np.array([])

 # Read/write video file
clip = cv2.VideoCapture("original.mp4")
out = cv2.VideoWriter('processed.mp4',cv2.VideoWriter_fourcc(*'MP4V'), 20.0, (1280,720))
length = int(clip.get(cv2.CAP_PROP_FRAME_COUNT))

bar = display(progress(frameCnt, length), display_id=True)

while(True):

    # Read frame from video
    success, img = clip.read()
    if not success:
        break

    # Start time measurement
    t1 = time.time()

    # Process image (use the LineDetector's process_image)
    result, deviation, left_curverad=detector.process_image(img)

    # Update estimates (use the Estimator's update)
    curvEst,slopeEst,devEst=estimator.update(left_curverad, deviation)

    # Set controller inputs
    controller.input["error" ] = devEst*4
    controller.input["delta" ] = slopeEst*40

    # Compute control
    controller.compute()
    control = controller.output["output"]

    # End time measurement
    t2 = time.time()

    # Draw on image (use the drawImage function)
    img=drawImage(img, devEst, curvEst)

    # Append arrays for plotting (use array = np.append(array, newElem))
    devs=np.append(devs, deviation)
    devFilts = np.append(devFilts, devEst)
    curs = np.append(curs, left_curverad)
    curFilts = np.append(curFilts, curvEst)
    slopeFilts = np.append(slopeFilts, slopeEst)
    controls = np.append(controls, control)

    # Write video (use the VideoWriter object named out)
    out.write(img)
    if(deviation>1):
      plt.imshow(img)
      plt.show()
    # Increate time elapsed and frame counter
    sum += (t2 - t1)
    frameCnt += 1

    # Update bar
    bar.update(progress(frameCnt, length))

clip.release()
out.release()

# Display runtime and fps
avgTime = sum / frameCnt * 1000
print("Average time: %f" % avgTime)
print("Average fps: %f" % (1000.0 / avgTime))

